//   ___  ___  ___  ___  ___        ___  _     ___ __   __  _   
//  | _ \| _ \| __|/ __|/ __|      | _ \| |   /   \\ \ / / | |  
//  |  _/|   /| _| \__ \\__ \      |  _/| |__ | - | \   /  |_|  
//  |_|  |_|_\|___||___/|___/      |_|  |____||_|_|  |_|   (_)  

// ---------------------
// add a bounce sound effect when 
// the ball collides with a paddle
// you'll have to create a new tune asset
// ---------------------

const e = createEngine(gameCanvas, 409, 246);

/* BEGIN BALL */
e.add({
	tags: ["ball"],
	solid: true,
	x: 178,
	y: 126,
    vx: 100,
    vy: 300,
    sprite: ball,
    scale: 2,
    bounce: 1,
    collides: (me, them) => {

      // check if thing I collided with has paddle tag
      if (them.hasTag("paddle")) {
        me.vx *= 1.3;
        me.vy *= 1.3;
      }

    },
	update: (obj) => {
      /* BOUNCE OFF OF TOP */
      if (obj.y < 0) {
        obj.vy *= -1;
        playTune(wall_bounce);
      }

      /* BOUNCE OFF OF BOTTOM */
      if (obj.y > e.height - obj.height) {
        obj.vy *= -1;
        playTune(wall_bounce);
      }
    },
})
/* END BALL */

/* BEGIN RED PADDLE */
e.add({
	tags: ["left-paddle", "paddle"],
	solid: true,
	x: e.width - 25,
	y: 13,
    sprite: left_paddle,
    scale: 4,
	update: (obj) => {
      if (e.heldKey("ArrowUp")) {
        obj.y -= 3;
      }

	  if (e.heldKey("ArrowDown")) {
        obj.y += 3;
      }

	},
})
/* END RED PADDLE */

/* BEGIN BLUE PADDLE */
e.add({
	tags: ["right-paddle", "paddle"],
	solid: true,
	x: 5,
	y: 13,
    sprite: right_paddle,
    scale: 4,
	update: (obj) => {
      if (e.heldKey("w")) {
        obj.y -= 3;
      }

	  if (e.heldKey("s")) {
        obj.y += 3;
      }
	},
})
/* END BLUE PADDLE */

e.start();
